import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faMessage} from '@fortawesome/free-solid-svg-icons'
import { faSun} from '@fortawesome/free-solid-svg-icons'
import { faBookmark} from '@fortawesome/free-solid-svg-icons'


import { faSquareCheck} from '@fortawesome/free-solid-svg-icons'

import tire from '../assets/images/tire.png'

const Auto_tire = () => {
    return (
<section className="autotire">
    <div className="container">
        <h2 className="autotire__title">Популярные шины</h2>
        <div className="autotire__nav">
            <a href="/" className="autotire__link">Автомобильные</a>
            <a href="/" className="autotire__link">Грузовые</a>
            <a href="/" className="autotire__link">Мотошины</a>
        </div>

    </div>
</section>

    );
};

export default Auto_tire;
